/*Table structure for table `client_device` */

DROP TABLE IF EXISTS `client_device`;

CREATE TABLE `client_device` (
  `clientDeviceId` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '客户端设备ID',
  `deviceUid` varchar(128) DEFAULT NULL COMMENT '设备唯一ID',
  `deviceCode` varchar(128) DEFAULT NULL COMMENT '设备编号',
  `stationCode` varchar(128) DEFAULT NULL COMMENT '设备所在车站代码',
  `deviceStatus` varchar(128) DEFAULT NULL COMMENT '设备状态',
  PRIMARY KEY (`clientDeviceId`)
) ENGINE=InnoDB AUTO_INCREMENT=19 DEFAULT CHARSET=utf8;

