  `filePath` varchar(256) DEFAULT NULL COMMENT '文件所在路径',
  `fileName` varchar(64) DEFAULT NULL COMMENT '文件名称',
  `fileFormat` varchar(64) DEFAULT NULL COMMENT '文件格式',
  `fileVersionNumber` varchar(128) DEFAULT NULL COMMENT '文件版本号',
