/*Table structure for table `device_mqtt_regist_logs` */

DROP TABLE IF EXISTS `device_mqtt_regist_logs`;

CREATE TABLE `device_mqtt_regist_logs` (
  `mqttRegistLogId` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '设备注册信息日志ID',
  `deviceuId` varchar(128) DEFAULT NULL COMMENT '设备唯一ID',
  `sendJson` text COMMENT '发送json',
  `receiveJson` text COMMENT '接收json',
  `createUser` varchar(32) DEFAULT NULL COMMENT '添加人',
  `createTime` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `sendTime` datetime DEFAULT NULL COMMENT '发送时间',
  PRIMARY KEY (`mqttRegistLogId`)
) ENGINE=InnoDB AUTO_INCREMENT=220 DEFAULT CHARSET=utf8;

