/*Table structure for table `maintenance_apply` */

DROP TABLE IF EXISTS `maintenance_apply`;

CREATE TABLE `maintenance_apply` (
  `maintenanceApplyId` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '维修申请单ID',
  `operationSubjectId` bigint(20) DEFAULT NULL COMMENT '运营主体ID',
  `equipmentId` bigint(20) NOT NULL COMMENT '运营设备ID',
  `applyNO` varchar(32) DEFAULT NULL COMMENT '申请单编号',
  `lineId` bigint(20) DEFAULT NULL COMMENT '线路ID',
  `stationId` bigint(20) DEFAULT NULL COMMENT '车站ID',
  `categoryName` varchar(32) DEFAULT NULL COMMENT '设备类型',
  `errorCode` varchar(32) DEFAULT NULL COMMENT '错误代码',
  `breakDescribe` varchar(512) DEFAULT NULL COMMENT '故障描述',
  `applyUser` varchar(32) DEFAULT NULL COMMENT '报修员',
  `applyDate` datetime DEFAULT NULL COMMENT '报修时间',
  `appointUser` varchar(32) DEFAULT NULL COMMENT '指派人',
  `appointUserId` bigint(20) DEFAULT NULL COMMENT '指派人ID',
  `appointDate` datetime DEFAULT NULL COMMENT '指派时间',
  `maintenanceUser` varchar(32) DEFAULT NULL COMMENT '维修人',
  `maintenanceUserID` bigint(20) DEFAULT NULL COMMENT '维修人ID',
  `arrivalTime` datetime DEFAULT NULL COMMENT '到达现场时间',
  `overTime` datetime DEFAULT NULL COMMENT '维修完成时间',
  `maintenanceDescribe` varchar(512) DEFAULT NULL COMMENT '维修描述',
  `remark` varchar(512) DEFAULT NULL COMMENT '备注',
  `applyStatus` varchar(32) DEFAULT NULL COMMENT '申请单状态',
  `speedAppraise` int(11) DEFAULT NULL COMMENT '速度评价',
  `serviceAppraise` int(11) DEFAULT NULL COMMENT '速度评价',
  `operationSpecificationAppraise` int(11) DEFAULT NULL COMMENT '操作规范评价',
  `wasFinished` varchar(32) DEFAULT NULL COMMENT '问题是否解决',
  `processDescribe` varchar(512) DEFAULT NULL COMMENT '处理描述',
  `appraiseDescribe` varchar(512) DEFAULT NULL COMMENT '评价描述',
  `noRepairReason` varchar(512) DEFAULT NULL COMMENT '未修复原因',
  `createUser` varchar(32) DEFAULT NULL COMMENT '添加人',
  `createTime` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `modifyUser` varchar(32) DEFAULT NULL COMMENT '修改人',
  `modifyTime` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `createUserId` bigint(20) DEFAULT NULL COMMENT '添加人Id',
  `appraiseWasFinished` varchar(32) DEFAULT NULL,
  PRIMARY KEY (`maintenanceApplyId`)
) ENGINE=InnoDB AUTO_INCREMENT=22 DEFAULT CHARSET=utf8;

