/*Table structure for table `maintenance_solution` */

DROP TABLE IF EXISTS `maintenance_solution`;

CREATE TABLE `maintenance_solution` (
  `solutionId` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '维修方案信息ID',
  `repairInfoId` bigint(20) NOT NULL,
  `maintenanceApplyId` bigint(20) DEFAULT NULL COMMENT '维修申请单ID',
  `processMode` varchar(512) DEFAULT NULL COMMENT '处理措施',
  PRIMARY KEY (`solutionId`)
) ENGINE=InnoDB AUTO_INCREMENT=36 DEFAULT CHARSET=utf8;

