/*Table structure for table `operations_equipment` */

DROP TABLE IF EXISTS `operations_equipment`;

CREATE TABLE `operations_equipment` (
  `equipmentId` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '运营设备ID',
  `operationSubjectId` bigint(20) DEFAULT NULL COMMENT '运营主体ID',
  `workSectionId` bigint(20) DEFAULT NULL COMMENT '所属工区',
  `lineId` bigint(20) NOT NULL COMMENT '线路ID',
  `stationId` bigint(20) DEFAULT NULL COMMENT '所属站点',
  `sparePartId` bigint(20) NOT NULL COMMENT '备件ID',
  `equipmentNo` varchar(128) DEFAULT NULL COMMENT '设备编号',
  `serialNumber` varchar(128) DEFAULT NULL COMMENT '序列号',
  `uniquelyIdentifies` varchar(128) DEFAULT NULL COMMENT '唯一标识',
  `status` varchar(32) DEFAULT NULL COMMENT '设备状态',
  `location` varchar(256) DEFAULT NULL COMMENT '所在位置',
  `remark` varchar(512) DEFAULT NULL COMMENT '备注',
  `createUser` varchar(32) DEFAULT NULL COMMENT '添加人',
  `createTime` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `modifyUser` varchar(32) DEFAULT NULL COMMENT '修改人',
  `modifyTime` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `qrCode` varchar(128) DEFAULT NULL COMMENT '二维码',
  `deviceuId` varchar(128) DEFAULT NULL COMMENT '设备唯一ID(注册)',
  `deviceCode` varchar(128) DEFAULT NULL COMMENT '设备编号(注册)',
  `stationCode` varchar(128) DEFAULT NULL COMMENT '设备所在车站代码(注册)',
  `fileServerIP` varchar(32) DEFAULT NULL COMMENT '文件服务器ip',
  `fileServerUserName` varchar(128) DEFAULT NULL COMMENT '文件服务器用户名',
  `fileServerPassword` varchar(128) DEFAULT NULL COMMENT '文件服务器密码',
  `token` varchar(128) DEFAULT NULL COMMENT '服务器返回的认证Token',
  `deviceStatus` varchar(64) DEFAULT NULL COMMENT '设备运行状态',
  `equipmentName` varchar(128) DEFAULT NULL COMMENT '设备名称',
  PRIMARY KEY (`equipmentId`)
