/*Table structure for table `org_line` */

DROP TABLE IF EXISTS `org_line`;

CREATE TABLE `org_line` (
  `lineId` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '线路ID',
  `operationSubjectId` bigint(20) DEFAULT NULL COMMENT '运营主体ID',
  `lineName` varchar(128) DEFAULT NULL COMMENT '线路名称',
  `lineCode` varchar(128) DEFAULT NULL COMMENT '线路编码',
  `headPerson` varchar(128) DEFAULT NULL COMMENT '负责人',
  `phone` varchar(128) DEFAULT NULL COMMENT '联系电话',
  `remark` varchar(512) DEFAULT NULL COMMENT '备注',
  `status` varchar(32) DEFAULT NULL COMMENT '状态',
  `createUser` varchar(32) DEFAULT NULL COMMENT '添加人',
  `createTime` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `modifyUser` varchar(32) DEFAULT NULL COMMENT '修改人',
  `modifyTime` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  PRIMARY KEY (`lineId`)
