/*Table structure for table `org_organization` */

DROP TABLE IF EXISTS `org_organization`;

CREATE TABLE `org_organization` (
  `orgId` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '组织结构Id',
  `operationSubjectId` bigint(20) DEFAULT NULL COMMENT '运营主体ID',
  `parentOrgId` bigint(20) DEFAULT NULL COMMENT '父机构ID',
  `orgName` varchar(32) DEFAULT NULL COMMENT '机构名称',
  `internalNumber` varchar(128) DEFAULT NULL COMMENT '内部编号',
  `headPerson` varchar(128) DEFAULT NULL COMMENT '负责人',
  `contactNumber` varchar(128) DEFAULT NULL COMMENT '联系电话',
  `description` varchar(512) DEFAULT NULL COMMENT '机构描述',
