/*Table structure for table `part_spare_part` */

DROP TABLE IF EXISTS `part_spare_part`;

CREATE TABLE `part_spare_part` (
  `sparePartId` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '备件ID',
  `sparePartTypeId` bigint(20) DEFAULT NULL COMMENT '备件类型ID',
  `partName` varchar(128) DEFAULT NULL COMMENT '备件名称',
  `brand` varchar(128) DEFAULT NULL COMMENT '品牌',
  `materiaCoding` varchar(128) DEFAULT NULL COMMENT '物资编码',
  `specificationModel` varchar(128) DEFAULT NULL COMMENT '规格型号',
  `size` varchar(128) DEFAULT NULL COMMENT '尺寸',
  `material` varchar(128) DEFAULT NULL COMMENT '材质',
  `units` varchar(128) DEFAULT NULL COMMENT '单位',
  `upperLimit` int(11) DEFAULT NULL COMMENT '库存上限',
  `lowerLimit` int(11) DEFAULT NULL COMMENT '库存下限',
  `remark` varchar(512) DEFAULT NULL COMMENT '备       注',
  `status` varchar(16) DEFAULT NULL COMMENT '状态',
  `createUser` varchar(32) DEFAULT NULL COMMENT '添加人',
  `createTime` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `modifyUser` varchar(32) DEFAULT NULL COMMENT '修改人',
  `modifyTime` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `partPinYin` varchar(100) DEFAULT NULL COMMENT '拼音缩写',
  PRIMARY KEY (`sparePartId`)
) ENGINE=InnoDB AUTO_INCREMENT=112 DEFAULT CHARSET=utf8;

