/*Table structure for table `part_spare_part_type` */

DROP TABLE IF EXISTS `part_spare_part_type`;

CREATE TABLE `part_spare_part_type` (
  `sparePartTypeId` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '备件类型ID',
  `operationSubjectId` bigint(20) DEFAULT NULL COMMENT '运营主体ID',
  `categoryName` varchar(128) DEFAULT NULL COMMENT '分类名称',
  `parentPartId` bigint(20) DEFAULT NULL COMMENT '父级ID',
  `sort` int(11) DEFAULT NULL COMMENT '排序位置',
  `remark` varchar(512) DEFAULT NULL COMMENT '备注',
  `status` varchar(16) DEFAULT NULL COMMENT '状态',
  `createUser` varchar(32) DEFAULT NULL COMMENT '添加人',
  `createTime` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `modifyUser` varchar(32) DEFAULT NULL COMMENT '修改人',
  `modifyTime` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `partTypePinYin` varchar(100) DEFAULT NULL COMMENT '拼音缩写',
  `sparePartTypeIds` text,
  PRIMARY KEY (`sparePartTypeId`)
) ENGINE=InnoDB AUTO_INCREMENT=412 DEFAULT CHARSET=utf8;

