/*Table structure for table `stock_goods_shelves` */

DROP TABLE IF EXISTS `stock_goods_shelves`;

CREATE TABLE `stock_goods_shelves` (
  `goodsShelvesId` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '货架ID',
  `warehouseId` bigint(20) DEFAULT NULL COMMENT '仓库ID',
  `houseNo` varchar(64) DEFAULT NULL COMMENT '房间号',
  `containerType` varchar(64) DEFAULT NULL COMMENT '货柜类型',
  `shelfNumber` varchar(64) DEFAULT NULL COMMENT '货架编号',
  `remark` varchar(512) DEFAULT NULL COMMENT '备注',
  `status` varchar(32) DEFAULT NULL COMMENT '状态',
  `createUser` varchar(32) DEFAULT NULL COMMENT '添加人',
  `createTime` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `modifyUser` varchar(32) DEFAULT NULL COMMENT '修改人',
  `modifyTime` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  PRIMARY KEY (`goodsShelvesId`)
) ENGINE=InnoDB AUTO_INCREMENT=184680 DEFAULT CHARSET=utf8;

