/*Table structure for table `stock_in_stock` */

DROP TABLE IF EXISTS `stock_in_stock`;

CREATE TABLE `stock_in_stock` (
  `inStockId` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '入库单ID',
  `applyId` bigint(20) DEFAULT NULL COMMENT '业务申请ID',
  `operationSubjectId` bigint(20) DEFAULT NULL COMMENT '运营主体ID',
  `inWarehouseId` bigint(20) NOT NULL COMMENT '要入库仓库ID',
  `inStockApplyNo` varchar(32) DEFAULT NULL COMMENT '单据号',
  `inStockUser` varchar(32) DEFAULT NULL COMMENT '入库人',
  `inStockUserId` bigint(20) DEFAULT NULL COMMENT '入库人ID',
  `inDate` datetime DEFAULT NULL COMMENT '入库日期',
  `inStockType` varchar(64) DEFAULT NULL COMMENT '入库类型',
  `inStockStatus` varchar(32) DEFAULT NULL COMMENT '入库状态',
  `createUser` varchar(32) DEFAULT NULL COMMENT '添加人',
  `createTime` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `modifyUser` varchar(32) DEFAULT NULL COMMENT '修改人',
  `modifyTime` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `outStockApplyNO` varchar(32) DEFAULT NULL COMMENT '出库单据号',
  `remark` varchar(512) DEFAULT NULL,
  PRIMARY KEY (`inStockId`)
