/*Table structure for table `sys_role` */

DROP TABLE IF EXISTS `sys_role`;

CREATE TABLE `sys_role` (
  `roleId` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '角色Id',
  `operationSubjectId` bigint(20) DEFAULT NULL COMMENT '运营主体ID',
  `roleCode` varchar(32) NOT NULL COMMENT '角色代码',
  `roleName` varchar(32) DEFAULT NULL COMMENT '角色名称',
