/*Table structure for table `sys_user` */

DROP TABLE IF EXISTS `sys_user`;

CREATE TABLE `sys_user` (
  `userId` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '用户Id',
  `orgId` bigint(32) DEFAULT NULL COMMENT '组织结构Id',
  `operationSubjectId` bigint(20) DEFAULT NULL COMMENT '运营主体ID',
  `userName` varchar(32) NOT NULL COMMENT '用户名',
  `password` varchar(32) NOT NULL COMMENT '密码',
  `photoUrl` varchar(256) DEFAULT NULL COMMENT '用户头像Url',
  `email` varchar(32) DEFAULT NULL COMMENT '邮箱',
  `realName` varchar(32) DEFAULT NULL COMMENT '真实姓名',
  `phone` varchar(16) DEFAULT NULL COMMENT '手机号',
  `status` varchar(32) DEFAULT NULL COMMENT '用户状态',
  `salt` varchar(32) DEFAULT NULL COMMENT '加密盐值',
  `position` varchar(128) DEFAULT NULL COMMENT '职位',
  `workNumber` varchar(128) DEFAULT NULL COMMENT '工号',
  `lastLoginTime` datetime DEFAULT NULL COMMENT '最后登录时间',
  `lastLoginIp` varchar(32) DEFAULT NULL COMMENT '最后登录IP地址',
  `remark` varchar(512) DEFAULT NULL COMMENT '备注',
  `createUser` varchar(32) DEFAULT NULL COMMENT '添加人',
  `createTime` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `modifyUser` varchar(32) DEFAULT NULL COMMENT '修改人',
  `modifyTime` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `sex` varchar(32) DEFAULT NULL,
  `realNamePinYin` varchar(32) DEFAULT NULL COMMENT '真实姓名拼音缩写',
  `realNameAllPinYin` varchar(64) DEFAULT NULL COMMENT '真实姓名拼音',
  `currentLoginTime` datetime DEFAULT NULL,
  `currentLoginIp` varchar(32) DEFAULT NULL,
  `openId` varchar(128) DEFAULT NULL,
  `wasDefaultManager` varchar(8) DEFAULT '0',
  PRIMARY KEY (`userId`)
) ENGINE=InnoDB AUTO_INCREMENT=155 DEFAULT CHARSET=utf8;

