/*Table structure for table `task_pending_task` */

DROP TABLE IF EXISTS `task_pending_task`;

CREATE TABLE `task_pending_task` (
  `pendingTaskId` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '待办任务ID',
  `taskType` varchar(64) DEFAULT NULL COMMENT '任务类型',
  `sourceId` bigint(20) DEFAULT NULL COMMENT '来源表ID',
  `status` varchar(32) DEFAULT NULL COMMENT '任务状态',
  `taskPersonId` bigint(20) DEFAULT NULL COMMENT '任务执行人ID',
  `title` varchar(128) DEFAULT NULL COMMENT '标题',
  `busiNo` varchar(64) DEFAULT NULL COMMENT '业务单号',
  `taskDescribe` varchar(512) DEFAULT NULL COMMENT '任务描述',
  `createUser` varchar(32) DEFAULT NULL COMMENT '添加人',
  `createTime` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `modifyUser` varchar(32) DEFAULT NULL COMMENT '修改人',
  `modifyTime` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  PRIMARY KEY (`pendingTaskId`)
) ENGINE=InnoDB AUTO_INCREMENT=270 DEFAULT CHARSET=utf8;

